  import * as React from 'react';
  import Box from '@mui/material/Box';
  import Link from '@mui/material/Link';
  import Grid from "@mui/material/Grid";
  import KeyboardDoubleArrowRightIcon from '@mui/icons-material/KeyboardDoubleArrowRight';
  import Container from '@mui/material/Container';
  import Typography from '@mui/material/Typography';
  import logoo from '../../Asserts/Logos/kiddostardez.png'



  
  const Footer = () => {
    return(
        <Box component="footer" style={{display:'flex',backgroundColor:"#ADE792", justifyContent:'center',alignItems:'center',marginRight:'100px'}}>
        <Box sx={{ display: 'flex' }}>
            <img src={logoo} alt="Logo" style={{ height: '80px',width:'100px', margin: '10px', flexGrow: 1 }} />
          </Box>

          <Box sx={{ display: 'flex',width:"100px" ,marginLeft:"150vh"}}>
           
          </Box>
       
      </Box>
      
        
   
        );}
export default Footer;

